import React, { Component, useState } from "react";

const UsersList = (props) => {
  const { isunique, Userdata, gameplayed, removeButton } = props;

  return (
    <div className="table">
      <div className="heading">
        <p>First Name</p>
        <p>Last Name</p>
        <p>User Name</p>
        <p>Game</p>
        <p>Action</p>
      </div>
      {Userdata.map((user) => (
        <div key={user} className="userdata">
          <p style={{ textAlign: "center" }}>{user.fname}</p>
          <p>{user.lname}</p>
          <p>{user.username}</p>
          <p>{gameplayed}</p>
          <button onClick={() => removeButton(user.username)}>Delete</button>
        </div>
      ))}
    </div>
  );
};
export default UsersList;
